import React from "react";
import "./CreatePost.css"
import { FaReddit } from "react-icons/fa";

export default function CreatePost() {
    return (
        <div>
            <h3>
            User Homepage
            </h3>
            Create a new post:
            <div className="post-container">
                <div>
                    <FaReddit/>
                </div>
                <input className="create-post"></input>

            </div>

        </div>
    )
}
